import React, { useState } from "react";
import './MapUI.scss';

function MapUI() {
    const [isMiscOpen, setIsMiscOpen] = useState(false);

    const toggleMiscSection = () => {
        setIsMiscOpen(!isMiscOpen);
    };

    return (
        <div className="map-ui">
            <button className="misc-button" onClick={toggleMiscSection}>Misc</button>
            {isMiscOpen && (
                <div className="misc-section">
                    {/* Content of the Misc section */}
                    <p>Miscellenious content</p>
                </div>
            )}

            {/* Additional UI elements will be added here later. */}
        </div>
    );
}

export default MapUI;
